import React, { useEffect, useState } from "react";
import { Outlet, useParams } from "react-router-dom";
import SideBarComponent from "../../components/SideBarComponent";
import RecipeSearchComponent from "../../components/RecipeSearchComponent";
import AvatarIcon from "../../images/user-icon.png";
import { UseAuthContext } from "../../hooks/useAuthContext";
import ProfilePictureChanger from "../../components/ProfilePictureChanger";

interface Ingredient {
  name: string;
  quantity: number;
  unit: string;
}

interface Recipe {
  img: string;
  _id: string;
  title: string;
  ingredients: Ingredient[];
}

function UserDashboardHome() {
  return (
    <div className="dashboard">
      <SideBarComponent />
      <header className="dashboard-header">
        <RecipeSearchComponent />
        <div className="dashboard-buttons-container display-f">
          <img onClick={<ProfilePictureChanger/>} className="avatar" src={AvatarIcon} alt="user-icon" />
          <div className="notification-icon-container"></div>
        </div>
      </header>
      <Outlet />
    </div>
  );
}

export default UserDashboardHome;
